import styled from "styled-components"

interface Props{
    texto: string
}

const Paragraph = styled.a`
font-weight: 400;
font-size: 16px;
line-height: 19px;
color: #0B3B60;
margin:0;
cursor: pointer;

&:hover {
    color: #87CEEB;
  }
`


export default function Paragrafo({texto}: Props) {
    return (
        <Paragraph>{texto}</Paragraph>
    )
}

export {}
